import React from 'react'
import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import { AccessTime, AccountBox, MoreHoriz } from "@material-ui/icons";
import img2 from './img2.jpg';




function BookCard() {

    const styles={
        image:{
            width:"100%",
            height:"100%"


        },
        cards:{
            width:"20%",
            height:"65%"

        },
        divs:{
            padding:10,
            height:"60%",
            backgroundColor:"blue",
        }
        ,
        horiz:{
            float:"right",
        }
    }




  return (
    <Card style={styles.cards}>


        <div style={styles.divs}>

        <img style={styles.image} alt=" " src={img2}></img>

        </div>
        <div style={{height:"50%"}}>
        <center>
            <Typography noWrap={true}  component="p">
                HARRY POTTER 
            </Typography>

            <Typography noWrap={true} component="p">
                Vivek Reddy S
            </Typography>
        </center>


        <CardActions>
            <IconButton >
                <AccessTime />
            </IconButton>
            15 min to read
            <IconButton>
                <AccountBox />
            </IconButton>
            15.6k feed

        </CardActions>
        <CardActions>
            <IconButton>
                <MoreHoriz style={styles.horiz} />
            </IconButton>

        </CardActions>

       </div>

    </Card>
  );
}

export default BookCard
